// src/HomePage.js
import React from "react";
import "./HomePage.css";
import analysisImg from "./assets/uber‑analysis.png";

export default function HomePage({ onAnalysClick }) {
  return (
    <div className="home">
      {/* LEFT ‑‑ title + button */}
      <div className="left">
        <h1 className="title">Uber Data Analysis</h1>

        {/* click handler is optional – add your own logic */}
        <button className="analysBtn" onClick={onAnalysClick}>
          Analys
        </button>
      </div>

      {/* RIGHT ‑‑ png */}
      <img src={analysisImg} alt="Uber analysis" className="hero" />
    </div>
  );
}
